import styled from "styled-components";
import { Row, Col, Button } from "antd";

export const containerCol = { xs: 16, sm: 11, md: 9, lg: 7, xl: 5 };
export const optionCol = { xs: 20, sm: 16, md: 12, lg: 10, xl: 8 };
export const halfCol = { xs: 9, sm: 7, md: 5, lg: 4, xl: 3 };

export const Container = styled.div`
	width: 100%;
	height: 100vh;

	display: flex;
	flex-direction: column;
	align-items: center;
	background-color: #f66a70;
`;

export const OptionsContainer = styled.div`
	display: flex;
	flex-direction: row;
	align-items: center;
`;

export const OptionBtn = styled(Button)`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;

	background: #eeeeee !important;
	color: #000000 !important;
	border: none;

	display: block;
	font-size: 25px;
	min-height: 30px !important;

	&:focus {
		background: #eeeeee;
		color: #000000;
	}
	&:active {
		background: #eeeeee;
		color: #000000;
	}

	@media (hover: hover) and (pointer: fine) {
		&:hover {
			background: #ffe36e !important;
			color: #ffffff !important;
		}
	}
`;

export const SelectBtn = styled.button`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;

	background: #eeeeee !important;
	color: #000000 !important;
	border: none;

	display: block;
	width: 100%;
	cursor: pointer;
	&:focus {
		background: #eeeeee;
		color: #000000;
	}
	&:active {
		background: #eeeeee;
		color: #000000;
	}
	@media (hover: hover) and (pointer: fine) {
		&:hover {
			background: #f66a70 !important;
			color: #ffffff !important;
		}
		&:active {
			background: #eeeeee;
			color: #000000;
		}
	}
`;
export const HalfBtn = styled.button`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;

	background: #eeeeee !important;
	color: #000000 !important;
	border: none;

	display: block;
	width: 40%;
	cursor: pointer;
	&:focus {
		background: #eeeeee;
		color: #000000;
	}
	&:active {
		background: #eeeeee;
		color: #000000;
	}
	@media (hover: hover) and (pointer: fine) {
		&:hover {
			background: #f66a70 !important;
			color: #ffffff !important;
		}
		&:active {
			background: #eeeeee;
			color: #000000;
		}
	}
`;

